import React, { Component } from "react";

class Item extends Component {
  render() {
    const { titre, image, description, url } = this.props;
    return (
      <div>
        <h4> {titre}</h4>
        <h4> {description}</h4>
        <img width="60px" src={image} alt="image" />
        <video src={url} alt="url" />
      </div>
    );
  }
}

export default Item;
